DROP TABLE IF EXISTS `posts`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `posts` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор поста',
  `user_id` int unsigned NOT NULL COMMENT 'Идентификатор пользователя, создавшего пост',
  `from_user_id` int unsigned DEFAULT NULL COMMENT 'Идентификатор пользователя при репосте',
  `header` varchar(255) DEFAULT NULL COMMENT 'Заголовок поста',
  `body` text NOT NULL COMMENT 'Текст поста',
  `is_only_top` tinyint(1) DEFAULT '0' COMMENT 'Признак фиксации наверху ленты',
  `is_public` tinyint(1) DEFAULT '1' COMMENT 'Признак публикации',
  `is_archived` tinyint(1) DEFAULT '0' COMMENT 'Признак архивации',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания поста',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления поста',
  PRIMARY KEY (`id`),
  KEY `posts_user_id_fk` (`user_id`),
  KEY `posts_from_user_id_fk` (`from_user_id`),
  CONSTRAINT `posts_from_user_id_fk` FOREIGN KEY (`from_user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `posts_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Таблица постов';
